local function GetActivity( ply , tbl , bool , visible )

    local wmin = 10^10
    local ent

     for k, v in pairs( tbl ) do

        local pos = v:GetPos():Distance( ply:GetPos() )

        if v:IsWeapon() then
            if not Iscarried( v ) then
                if wmin > pos and !BlacklistWeapon[ ply ][v] then --and IsVisibleOnScreen( ply , v ) 
                    wmin = pos
                    ent = v
                end
            end
        end
        if v:IsPlayer() and not bool then
            if v:Alive() then
                if wmin > pos and pos != 0  then
                    if IsVisibleOnScreen( ply , v ) or visible then
                        wmin = pos
                        ent = v
                    end
                end
            end
        end
        

        if wmin < 100 then
            ent = v
            break
        end
    end

    return ent
end



local function reconstruct_path( cameFrom, current )
    local total_path = { current }

    current = current:GetID()
    while ( cameFrom[ current ] ) do
        current = cameFrom[ current ]
        table.insert( total_path, navmesh.GetNavAreaByID( current ) )
    end
    return total_path
end


local function heuristic_cost_estimate( start, goal )
    return start:GetCenter():Distance( goal:GetCenter() )
end

local function Astar( start, goal )
    if ( !IsValid( start ) || !IsValid( goal ) ) then return false end
    if ( start == goal ) then return true end

    start:ClearSearchLists()

    start:AddToOpenList()

    local cameFrom = {}

    start:SetCostSoFar( 0 )

    start:SetTotalCost( heuristic_cost_estimate( start, goal ) )
    start:UpdateOnOpenList()

    while ( !start:IsOpenListEmpty() ) do
        local current = start:PopOpenList() 
        if ( current == goal ) then
            return reconstruct_path( cameFrom, current )
        end

        current:AddToClosedList()

        for k, neighbor in pairs( current:GetAdjacentAreas() ) do
            local newCostSoFar = current:GetCostSoFar() + heuristic_cost_estimate( current, neighbor )

            if ( neighbor:IsUnderwater() ) then
                continue
            end

            if ( ( neighbor:IsOpen() || neighbor:IsClosed() ) && neighbor:GetCostSoFar() <= newCostSoFar ) then
                continue
            else
                neighbor:SetCostSoFar( newCostSoFar );
                neighbor:SetTotalCost( newCostSoFar + heuristic_cost_estimate( neighbor, goal ) )

                if ( neighbor:IsClosed() ) then

                    neighbor:RemoveFromClosedList()
                end

                if ( neighbor:IsOpen() ) then


                    neighbor:UpdateOnOpenList()
                else
                    neighbor:AddToOpenList()
                end

                cameFrom[ neighbor:GetID() ] = current:GetID()
            end
        end
    end

    return false
end

local function AstarVector( start, goal )
    local startArea = navmesh.GetNearestNavArea( start )
    local goalArea = navmesh.GetNearestNavArea( goal )
    return Astar( startArea, goalArea )
end

local function drawThePath( path, time )
    local prevArea
    for _, area in pairs( path ) do
        debugoverlay.Sphere( area:GetCenter(), 8, time or 9, color_white, true  )
        if ( prevArea ) then
            debugoverlay.Line( area:GetCenter(), prevArea:GetCenter(), time or 9, color_white, true )
        end

        area:Draw()
        prevArea = area
    end
end

local rePathDelay = 1


local function FixMovement(cmd , ang )

    local vec = Vector( cmd:GetForwardMove() , cmd:GetSideMove(), 0)
    local vel = math.sqrt(vec.x*vec.x + vec.y*vec.y)
    local mang = vec:Angle()
    local yaw 

    yaw = cmd:GetViewAngles().y - ang.y + mang.y

    if ((cmd:GetViewAngles().p+90)%360) > 180 then
        yaw = 180 - yaw
    end

    yaw = ((yaw + 180)%360)-180
    cmd:SetForwardMove(math.cos(math.rad(yaw)) * vel)
    cmd:SetSideMove(math.sin(math.rad(yaw)) * vel)

end

local function Movetopos( ply , pos , cmd )

    Focus[ ply ] = 30

   local currentArea = navmesh.GetNearestNavArea( ply:GetPos() )

    // internal variable to regenerate the path every X seconds to keep the pace with the target player
    ply.lastRePath = ply.lastRePath or 0

    // internal variable to limit how often the path can be ( re )generated
    ply.lastRePath2 = ply.lastRePath2 or 0

    if ( ply.path && ply.lastRePath + rePathDelay < CurTime() && currentArea != ply.targetArea ) then
        ply.path = nil
        ply.lastRePath = CurTime()
    end

    if ( !ply.path && ply.lastRePath2 + rePathDelay < CurTime() ) then

        local targetPos = pos 
        local targetArea = navmesh.GetNearestNavArea( targetPos ) or false

        if targetArea == false then
            return
        end

        ply.targetArea = nil
        ply.path = Astar( currentArea, targetArea )
        if ( !istable( ply.path ) ) then 
            ply.path = nil 
            ply.lastRePath2 = CurTime()
            return
        end

        // TODO: Add inbetween points on area intersections
        // TODO: On last area, move towards the target position, not center of the last area
        table.remove( ply.path )
    end


    if ( !ply.path || #ply.path < 1 ) then
        ply.path = nil
        ply.targetArea = nil
        return
    end

    --drawThePath( ply.path, .1 ) // Draw the path 

    if ( !IsValid( ply.targetArea ) ) then
        ply.targetArea = ply.path[ #ply.path ]
    end

    if ( !IsValid( ply.targetArea ) || ( ply.targetArea == currentArea && ply.targetArea:GetCenter():Distance( ply:GetPos() ) < 64 ) ) then
        table.remove( ply.path ) // Removes last element
        ply.targetArea = nil
        return
    end


    local targetang = ( ply.targetArea:GetCenter() - ply:GetPos() ):GetNormalized():Angle()

    ply:SetEyeAngles( Lerp(0.3 , ply:EyeAngles() , Angle( targetang.p , targetang.y , 0 )  ) )

    FixMovement(cmd ,  ply:EyeAngles() )

end

local function BotAttack( ply , cmd , victim )
    Targets[ ply ] = victim
    Focus[ ply ] = 500
    lastActivity[ ply ] = 10

    ply:SetEyeAngles( (GetHeadPos( victim  ) - ply:GetShootPos()):Angle() )
    ply:ViewPunch( Angle( math.random( -5 , 5 ) , 0 , 0 ) )
    --cmd:SetViewAngles( (GetHeadPos( victim  ) - ply:GetShootPos()):Angle() + Angle( math.random( -0.0001 , 0.0001 ), math.random( -0.0001 , 0.0001 ) , 0 ) )
    cmd:SetForwardMove( ply:GetRunSpeed() )
    cmd:SetButtons(bit.bor( cmd:GetButtons() , IN_SPEED ) )

    cmd:SetForwardMove( 0 )
    cmd:SetSideMove( math.random(  ply:GetRunSpeed()*-1 , ply:GetRunSpeed() ) )
    
    if IsValid( ply:GetActiveWeapon() ) then

        if ply:GetActiveWeapon():GetNextPrimaryFire() < CurTime() + 0.05 then
            cmd:SetButtons( IN_ATTACK )
        else
            cmd:RemoveKey( IN_ATTACK )
            if  ply:GetActiveWeapon():Clip1() == 0 then
                cmd:SetButtons(bit.bor( cmd:GetButtons() , IN_RELOAD ) )
            end
        end

        if ply:GetActiveWeapon():GetNextSecondaryFire() < CurTime() and math.random( 0 , 500 ) == 500 then
            cmd:SetButtons( IN_ATTACK2 )
        else
            cmd:RemoveKey( IN_ATTACK2 )
        end

    end
end



local function GetAmmo( ply , wp )
    if ( !IsValid( ply ) ) then return -1 end

    local wep = wp
    if ( !IsValid( wep ) ) then return -1 end
    if ply:GetAmmoCount( wep:GetPrimaryAmmoType() ) == -1 then
        return 1
    end
    return ply:GetAmmoCount( wep:GetPrimaryAmmoType() )
end

local function NeedAmmo( ply , wp )
    if !IsValid( wp ) then return false end

    if  wp:Clip1() == 0 then
        return true
    end

    if  wp:Clip1() == -1 then
        return ply:GetAmmoCount( wp:GetPrimaryAmmoType() ) < 0
    end

end


