     if ply:GetVelocity():Length() < 20 and Velocity[ ply ] < 20 then
            BlacklistWeapon[ ply ] = BlacklistWeapon[ ply ] or {}
            BlacklistWeapon[ ply ][ent2] = true
    else
        if true then
            Movetopos( ply , ent2:GetPos() , cmd )
            cmd:SetForwardMove( ply:GetRunSpeed() )
            return
        end

        local t
        if Targets[ ply ] then
            if Focus[ ply ] < 10 and IsVisibleOnScreen( ply , Targets[ ply ] ) then
                t = Targets[ ply ] 
            end
        end

        WantedWeapon[ ply ] = ent2
        if not t then
            t = ent2
        end
        --cmd:SetViewAngles( ( GetHeadPos( t ) - ply:GetShootPos()):Angle() )

        ply:SetEyeAngles( ( GetHeadPos( t ) - ply:GetShootPos()):Angle() )

        cmd:SetButtons(bit.bor( cmd:GetButtons() , IN_FORWARD ) )
        cmd:SetButtons(bit.bor( cmd:GetButtons() , IN_SPEED ) )
        Velocity[ ply ] = ply:GetVelocity():Length()

        local vec = Vector( ply:GetRunSpeed() , 0 , 0)
        local vel = math.sqrt(vec.x*vec.x + vec.y*vec.y)
        local mang = vec:Angle()
        local yaw 

        yaw = ply:EyeAngles().y - (ent2:GetPos() - ply:GetShootPos()):Angle().y + mang.y

        if ((cmd:GetViewAngles().p+90)%360) > 180 then
            yaw = 180 - yaw
        end

        yaw = ((yaw + 180)%360)-180
        cmd:SetForwardMove(math.cos(math.rad(yaw)) * vel)
        cmd:SetSideMove(math.sin(math.rad(yaw)) * vel)

        return
    end
end

hook.Add("PostPlayerDeath","dm_clasic_bot_AI",function (ply)
    if ply:IsBot() then
        timer.Simple( 2 ,function()
            ply:Spawn()
        end)
    end
end)

hook.Add( "StartCommand", "dm_clasic_bot_AI", function( ply, cmd )
    
    if not ply:IsBot() then return end

    cmd:ClearMovement()
    cmd:ClearButtons()

    if not Velocity[ ply ] then
        Velocity[ ply ] = 600
        lastActivity[ ply ] = 1
        BlacklistWeapon[ ply ] = {}
        Focus[ ply ] = 0
        Thinking[ ply ] = 0
    end

    Thinking[ ply ] = Thinking[ ply ] - 1

    cmd:SetButtons(bit.bor( cmd:GetButtons() , IN_SPEED ) )
    cmd:SetForwardMove( ply:GetRunSpeed() )

    if math.random( 0 , 500 ) == 500 then
        cmd:SetButtons(bit.bor( cmd:GetButtons() , IN_JUMP ) )
        cmd:SetUpMove( 10000 )
    end

    if !ply:Alive() then     
        BlacklistWeapon[ ply ] = {}
        WantedWeapon[ ply ] = nil
        Targets[ ply ] = nil
        lastActivity[ ply ] = 0
        return
    end

    if Focus[ ply ] > 0 then
        Focus[ ply ] = Focus[ ply ] -1
    end

    if IsValid( Targets[ ply ] ) then
        if !Targets[ ply ]:Alive() then
            Targets[ ply ] = nil
        end
    else
        Targets[ ply ] = nil
    end

    local ent = Targets[ ply ]

    if !IsValid( ent ) then
        ent = GetActivity( ply , player.GetAll() )
    else
        if !ent:Alive() or not IsVisibleOnScreen( ply , ent ) then
            if Focus[ ply ] < 60 then
                ent = GetActivity( ply , player.GetAll() )
            else
                ent = nil
            end
        end
    end

    local wp = ply:GetActiveWeapon()
    for k,v in pairs( ply:GetWeapons() ) do
        if GetAmmo( ply , v ) >= GetAmmo( ply , wp ) then
            wp = v
        end
    end

    if IsValid( wp ) then
        cmd:SelectWeapon( wp )    
    end

    if ent then
        if ent:GetPos():Distance( ply:GetPos() ) < 2000 then
            if not NeedAmmo( ply , wp ) then
                BotAttack( ply , cmd , ent )
                Velocity[ ply ] = ply:GetVelocity():Length()
                return
            end
        end
    end

    local ent2 = WantedWeapon[ ply ]

    if IsValid( WantedWeapon[ ply ] ) and !BlacklistWeapon[ ply ][WantedWeapon[ ply ]] and !Iscarried( WantedWeapon[ ply ] ) then
        ent2 = WantedWeapon[ ply ]
    else
        ent2 = GetActivity( ply , ents.GetAll() , true )
    end

    if NeedAmmo( ply , wp ) and IsValid( ent2 ) and Focus[ ply ] < 10  or IsValid( ent2 ) and !IsValid( ent ) and Focus[ ply ] < 10 then
        --BotGetAmmo( ply , ent2 , cmd )
        Movetopos( ply ,ent2:GetPos() , cmd )
        Velocity[ ply ] = ply:GetVelocity():Length()
        return
    end

    if ent and not NeedAmmo( ply , wp ) then
        BotAttack( ply , cmd , ent )
        Velocity[ ply ] = ply:GetVelocity():Length()
        return
    end

    if IsValid( Targets[ ply ] ) and not NeedAmmo( ply , wp ) and IsVisibleOnScreen( ply , Targets[ ply ] ) and Focus[ ply ] < 10 then
        BotAttack( ply , cmd , Targets[ ply ] )
        return
    end

    if ply:GetEyeTrace().Entity:IsPlayer() then
        BotAttack( ply , cmd , ply:GetEyeTrace().Entity )
        return
    end

    if ply:GetEyeTrace().HitPos:Distance( ply:GetShootPos() ) < 50 and Focus[ ply ] < 1 then
        cmd:SetButtons(bit.bor( cmd:GetButtons() , IN_JUMP ) )
        cmd:SetSideMove( math.random( - 5, 5 ))
        cmd:SetButtons(bit.bor( cmd:GetButtons() , IN_FORWARD ) )
        ply:SetEyeAngles( Angle(0 , 0 + CurTime()*math.random( 0 , 30 ) , 0) )
        return
    end

    if ply:GetVelocity():Length() < 3 and  Focus[ ply ] < 1 then
        Focus[ ply ] = 30
        ply:SetEyeAngles( Angle( 0 , math.random( -180 , 180 ) , 0 ) )
        return
    end

    if Targets[ ply ] and Focus[ ply ] < 90 then
        if IsVisibleOnScreen( ply , Targets[ ply ] ) then
            ent = Targets[ ply ]
        end
    end

    if not ent and Focus[ ply ] < 80 then
        ent = GetActivity( ply , player.GetAll() )
    end

    if ent and not NeedAmmo( ply , wp ) then
        if IsVisibleOnScreen( ply , ent ) then
            BotAttack( ply , cmd , ent )
            Velocity[ ply ] = ply:GetVelocity():Length()
            return
        end
    end

    local ent2 = GetActivity( ply , ents.GetAll() , true )

    if ent2 and Focus[ ply ] < 10 then
        Movetopos( ply , ent2:GetPos() , cmd )
        cmd:SetForwardMove( ply:GetRunSpeed() )
        return
    end

    if Targets[ ply ] and Focus[ ply ] < 70 then
        Movetopos( ply , Targets[ ply ]:GetPos() , cmd )
        return
    else
        ent = GetActivity( ply , player.GetAll() , false , true )

        if ent and Focus[ ply ] < 10 then
            Movetopos( ply ,ent:GetPos() , cmd )
            Targets[ ply ] = ent
            return
        end
    end

    Thinking[ ply ] = Thinking[ ply ] + 2

    if Thinking[ ply ] > 100 then
        Thinking[ ply ] = Thinking[ ply ] - 20
        ply:SetEyeAngles( Angle( 0 , math.random( -180 , 180 ) , 0 ) )
    end

    if Thinking[ ply ] > 500 then
        ply:Kill()
    end


    return

end )

